<?php

namespace Appleton\Taxes\Seeds\US;

use Appleton\Taxes\Countries\US\FederalIncome;
use Appleton\Taxes\Countries\US\FederalUnemployment;
use Appleton\Taxes\Countries\US\Medicare;
use Appleton\Taxes\Countries\US\MedicareEmployer;
use Appleton\Taxes\Countries\US\SocialSecurity;
use Appleton\Taxes\Countries\US\SocialSecurityEmployer;
use DB;
use Illuminate\Database\Seeder;

class USSeeder extends Seeder
{
    public function run()
    {
        if (DB::table(config('taxes.governmental_unit_areas'))->where('name', 'US')->exists()) return;

        $id = DB::table(config('taxes.governmental_unit_areas'))->insertGetId([
            'name' => 'US',
            'area' => '',
        ]);

        DB::table(config('taxes.tax_areas'))->insert([[
            'name' => 'Federal Income Tax',
            'tax' => FederalIncome::class,
            'governmental_unit_area_id' => $id,
        ],[
            'name' => 'Federal Unemployment Tax',
            'tax' => FederalUnemployment::class,
            'governmental_unit_area_id' => $id,
        ],[
            'name' => 'Medicare Tax',
            'tax' => Medicare::class,
            'governmental_unit_area_id' => $id,
        ],[
            'name' => 'Medicare Employer Tax',
            'tax' => MedicareEmployer::class,
            'governmental_unit_area_id' => $id,
        ],[
            'name' => 'Social Security Tax',
            'tax' => SocialSecurity::class,
            'governmental_unit_area_id' => $id,
        ],[
            'name' => 'Social Security Employer Tax',
            'tax' => SocialSecurityEmployer::class,
            'governmental_unit_area_id' => $id,
        ]]);
    }
}
